jQuery(function($) {
    var sPS = $('#subPageSelector');

    if ( sPS.length == 0 ) {
        return;
    }

    $('.noScript', sPS).hide();

    var comboButton = $('#subPageComboButton');
    var flyout      = comboButton.siblings('.flyout');

    comboButton
        .show()
        .hover(_hoverIn, _hoverOut)
        .click(function(e) {
            e.stopPropagation();
            
            var button = $(this);
            _toggleDisplay.call(button);
            
            $(document).one('click', function() {
                _toggleDisplay.call(button, false);
            });
        });

    flyout.click(function(e) {
        e.stopPropagation();
    });

    function _toggleDisplay(forceOpen) {
        if ( this.hasClass('open') || (forceOpen === false) ) {
            flyout.slideUp();
        } else {
            flyout.slideDown();
        }
        this.toggleClass('open', forceOpen);
    }

    function _hoverIn(e) {
        $(this).addClass('hover');
    }

    function _hoverOut(e) {
        $(this).removeClass('hover');
    }
 });

$(function() {
    $('.pricingTable.yui-navset')
        .find('.tabs li:first, .yui-content .content:first')
        .addClass('selected')
        .end();

    constructTables();

    selectTab($('.pricingTable.yui-navset:first .tabs li:first'));

    function handleRegionSelect(e) {
        selectTab($(':selected', e.target));
    }

    function selectTab(tab) {
        if ( ! tab || ! tab.length ) {
            return;
        }

        var region = tab.val();

        $('.pricingTable.yui-navset')
            .find('.controls .region select')
              .val(region)
            .end()
            .find('.content.' + region).each(function() {
                $(this).show()
                    .siblings().hide();
            });
    }

    function constructTables() {
        $('.pricingTable.yui-navset').each(function() {
            var pricingTable = $(this);

            var regions = [];
            var isFirst = true;
            $('.yui-content .content', this).each(function() {
                var table = $(this);
                regions.push({
                    region: getRegionFromClass(table),
                    title: $.trim($('caption', table).html())
                });

                if ( isFirst ) {
                    table.addClass('selected');
                    isFirst = false;
                } else {
                    table.hide();
                }
            });

            pricingTable.prepend(constructControls(regions));
        });
    }

    function constructControls(regions) {
        var controls = $('<div class="controls"/>');

        controls.append(buildRegionControl(regions));

        return controls;
    }

    function buildRegionControl(regions) {
        var container = $('<div class="region"/>').html('Region:');

        var select = $('<select/>').change(handleRegionSelect);

        $.each(regions, function(i, info) {
            select.append($('<option/>')
                          .val(info.region)
                          .html(info.title));
        });
        
        container.append(select);

        return container;
    }

    function getRegionFromClass(elem) {
        return (elem.attr('class').match(/(awstab-\S+)/))[1];
    }
});


